import React from 'react';
import { css, keyframes } from 'emotion'


const Moody_text = () => {
    return (
        <div className={styles.title_holder}>
            <h1 className={styles.title}>Moody</h1>
        </div>
    )
}

const styles = {
    title_holder: css` 
        width: 100%;
        height: 180px;
        background-color: black;
        color: white;
        text-align: center;
        `,
        title: css`
        position: relative;
        font-family: 'Passion One', cursive;
        top: 10%;
        font-weight: 800;
        font-size: 63px;
        line-height: 28px
        `
}

export default Moody_text;
